INSERT INTO `announcement` (`annID`, `instructorID`, `course_code`, `content`, `ann_date`, `ann_time`, `title`, `yearID`) VALUES
(18, 2, 'CS 212', 'hey', '2021-11-01', '21:57:03', 'hey', 0),
(25, 2, 'CP 123', 'we will be having our test this weekend', '2021-11-07', '09:20:43', 'test one', 1),
(28, 35, 'CP 211', 'Greetings, welcome to the course CP 211 Introduction to Linux/Unix. As open-source software, Linux carries potential as it is free, provides customization possibilities, improved security, and has a huge supporting community. \r\nTo make maximum use of the course, I urge all of you to have an installed version of Linux/Unix on your laptops (any distribution will do - ubuntu, fedora, Debian, etc). The course is going to be practical-oriented and really engaging. \r\nKaribuni Sana\r\n', '2021-11-12', '09:01:44', 'Welcome', 1),
(29, NULL, 'ET 311', 'Hallow, I am Nima Shidende, ET 311-: PLANNING AND MANAGING LEARNING TECHNOLOGIES IN EDUCATION      (10.0 CREDITS) and I will be your instructor for the course. \r\n', '2021-11-15', '11:58:31', 'Welcome message to ET 311 Class of 2021/2022', 1),
(30, NULL, 'ET 311', 'I welcome all of you and I would encourage all of you to introduce yourself by posting a short message in discussion forum.  I can be reached through nshidende2019@gmail.com', '2021-11-15', '12:01:49', 'Welcome message2 to ET 311 Class of 2021/2022', 1),
(31, NULL, 'HI 213', 'Hallow, I am Nima Shidende, HI 213-: E-HEALTH and I will be your instructor for the course. I welcome all of you and I would encourage all of you to introduce yourself by posting a short message in discussion forum. I can be reached through nshidende2019@gmail.com', '2021-11-15', '12:03:44', 'Welcome message to HI 213 Class of 2021/2022', 1),
(32, 54, 'CT 212', 'Useful online library where you can get all reference books for CT 212.\r\nHere is the link: https://z-lib.org/', '2021-11-16', '12:33:34', 'Online Library', 1),
(34, NULL, 'ET 311', 'Hallow, I am Nima Shidende, nd I will be your instructor for the course: IM 311-Customer Relationship Management System (7.5 CREDITS). I welcome all of you and I would encourage all of you to introduce yourself by posting a short message in discussion forum. I can also be reached through nshidende2019@gmail.com ', '2021-11-16', '16:27:29', 'Welcome message to IM 311 Class of 2021/2022', 1),
(35, NULL, 'CP 313', 'Hello as we discussed last time, this course will be taught by two instructors: - Dr. Noe and Mr.Siphael', '2021-11-16', '17:45:41', 'Course Instructors', 1),
(36, NULL, 'CP 313', 'Every student should install the latest version of Android studio to his/her computer.', '2021-11-16', '19:06:10', 'Android Studio', 1),
(37, NULL, 'CP 313', 'Follow this link to download the current version of Android Studio.\r\nhttps://developer.android.com/', '2021-11-16', '19:08:33', 'Android Studio', 1),
(38, 54, 'CT 315', 'You can access an online library through https://z-lib.org/\r\nWhen you register to this library, You can download 10 books per day.', '2021-11-18', '17:03:54', 'Online Library', 1),
(39, 54, 'CN 411', 'You can access an online library through https://z-lib.org/ When you register to this library, You can download 10 books per day.', '2021-11-18', '17:04:32', 'Online Library', 1),
(40, 54, 'CT 315', 'Read chapter one of the book \"From GSM to LTE-Advanced An Introduction to Mobile Networks and Mobile Broadband by Martin Sauter\"', '2021-11-18', '17:10:52', 'Review', 1),
(41, 54, 'CT 212', 'I have uploaded tutorial one, please pass through tutorial one', '2021-11-29', '10:36:04', 'TUTORIAL ONE', 1),
(43, 54, 'CT 315', 'Read Chapter Six of the book \"Wireless and Mobile Data Networks\", by Aftab Ahmad. The chapter gives details on MOBILITY AND INTERNET. PROTOCOLS', '2021-11-29', '10:59:50', 'Review', 1),
(44, NULL, 'BT 212', 'Our semianr session will be done online using Zoom meeting. Everyone should have a laptop/mobile phone installed with Zoom application. Use the following invitation link a scheduled Zoom meeting.\r\n\r\nTopic: BT 212 Assigment One\r\nTime: Nov 30, 2021 10:00 AM Nairobi\r\n\r\nJoin Zoom Meeting\r\nhttps://us04web.zoom.us/j/71313977704?pwd=a3ZLRGFxYmxyODN2anpBMXVWd3Fydz09\r\n\r\nMeeting ID: 713 1397 7704\r\nPasscode: MA7948', '2021-11-29', '17:52:47', 'SEMINAR MEETING', 1),
(45, 59, 'EC 211', 'Lecture #04 on 2nd December 2021 requires a revision on integration. Therefore, it is better to brush your skills on simple integration techniques before appreciating the use of Laplace transform in analyzing electrical circuits in Lecture#05', '2021-12-01', '17:05:24', 'Laplace Transform', 1),
(46, 96, 'ME 613', 'Good evening every one wherever you ma be. I am politely reminding you about the submission of the assignment given to you by today 23.59. Let us take on a very serious note. Let us remind those who have not submitted to do so. Enjoy your evening', '2021-12-02', '17:48:43', 'Collection of Assignment 1', 1),
(47, NULL, 'IM 218', 'I have posted the assignment, please take your time to read and also write a very nice document regarding the submitted question;\r\nDeadline : 8/11/2021', '2021-12-05', '11:37:17', 'Assignment', 1),
(48, 96, 'ME 613', 'Hallow everyone, you politely reminded to resubmit assignment one in a PDF format. Additionally, the groups are automatically created for you to perform group assignments. Please see them and do the needful. Let\'s keep in touch', '2021-12-06', '11:47:25', 'Re-submission of Assignment', 1),
(49, 96, 'ME 213', 'Good evening to everyone, it is my pleasure to see many of you joining the forum. Please try to encourage your colleagues to register in the system so that they can do the assignments. Provide necessary assistant to those in need. I also urge everyone to do the assignments on time to avoid inconveniences. Enjoy ', '2021-12-06', '18:42:43', 'Reminder to register in the system', 1),
(50, 35, 'CP 211', 'New Lab assignment (06/12/2021)', '2021-12-06', '20:02:49', 'Lab Assignment', 1),
(51, NULL, 'CP 311', 'This is to inform you all that TEST_ONE for CP 311 will be on 12th December, 2021 at 02:00 Pm to 04:00 Pm. Venue will be Cive Auditorium', '2021-12-07', '14:51:30', 'CP 311_TEST_ONE', 1),
(52, NULL, 'IM 218', 'Use your existing groups (not more than 10 students ) to prepare the power points for assignment 4, and this shall be presented next week in the lecture session.', '2021-12-07', '17:26:43', 'PRESENTATION', 1),
(53, NULL, 'CS 0215', 'We were supposed to cover that lecture in today session but unfortunately it is the public holiday, so take your time to read and understand that lecture.', '2021-12-09', '15:23:59', 'Lecture 4 (Loop Statement)', 1),
(54, NULL, 'CP 316', 'Please upload the file of your Assignment One here before 15 Dec 2021. Submission outside the UDOM classroom will not be considered for marking. ', '2021-12-13', '11:06:44', 'Assignment One', 1),
(55, NULL, 'CD 0114', 'With The Provided Manual Book Go Through Chapter 5 As The Guideline Chapter To Accomplish Your Lab Work.', '2021-12-13', '14:12:46', 'LAB ASSIGNMENT TIPS', 1),
(56, NULL, 'FB 0115', 'Day: we will conduct test on Monday next week (20/12/2021).\r\nCoverage: from lecture one up to lecture five.\r\nTime: to be communicated.', '2021-12-13', '15:14:51', 'TEST ', 1),
(57, NULL, 'HI 112', 'Assigment Three is a Make up Assignment for those who missed assignment One', '2021-12-13', '17:46:24', 'Assigment Three', 1),
